import './App.css';
import Manu from './webpage_component/Manu';
import { BrowserRouter, Route, Switch } from "react-router-dom";

function App() {
  return (
    <>
      <Manu />
      <BrowserRouter>
        <Switch>
          <Route exact path="/" component={Home} />
          <Route exact path="/about" component={GOT} />
        </Switch>
      </BrowserRouter>
    </>
  );
}

export default App;
